import React from 'react';
import Header from './Components/header'

class App extends React.Component
{
  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
    fetch("http://localhost:9000/testAPI", {method: "post", body: "hello"})
      .then(res => res.text())
      .then(res => this.setState({ apiResponse: res }));
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {
    return (
      <div>
        <Header />
        <p>{this.state.apiResponse}</p>
      </div>
    );
  }
}

export default App;
